import { GET_TOUR_SUCCESS, GET_TOUR_FAIL } from "../types";

export default function (state = [], action) {
  const { type, payload } = action;
  switch (type) {
    case GET_TOUR_SUCCESS:
      return {
        ...state,
        ...payload,
      };
    case GET_TOUR_FAIL:
      return {
        ...state,
      };
    default:
      return state;
  }
}
